import axios from 'axios'

function App() {
  const [movie, setMovie] = useState(null);
  useEffect(()=>{
  axios.get('https://api.themoviedb.org/3/authentication/token/new?api_key=7d01e2f21937769f340b6be2e4f1f146')
  .then (data =>{
    setMovie(data.data)
  })
  .catch(error => console.log(error))
}, [])
  return (
    <div className="App">
      {movie &&(
        <h1>{movie.data.name}</h1>
        )}
    </div>
  );
}

export default App;
